const styles = (theme) => ({
  container: {
    overflowY: 'auto',
    paddingLeft: 32,
    paddingRight: 32,
  },
  lossTime: ({ isMobile, isTablet }) => ({
    marginTop: isMobile ? 20 : isTablet ? 0 : 19,
  }),
  lossTimeError: {
    marginLeft: theme.spacing(1),
  },
  warningMessage: {
    marginTop: -4,
  },
  warningMessageDate: {
    marginTop: -4,
    marginLeft: theme.spacing(1),
  },
});

export default styles;
